class Credits extends PublicModule
{
    use Singleton;

    /**
     * Displays credits.
     */
    public function publicCall(): void
    {
        $credits = [];
        foreach(Language::getInstance()->getStrings() as $curIndex => $curString)
            if(Functions::strpos($curIndex, 'credits') !== false)
                $credits[] = $curString;
        array_shift($credits); //Remove title
        $_SESSION['dtfl'] = true; //*g*
        WhoIsOnline::getInstance()->setLocation('Credits');
        PlugIns::getInstance()->callHook(PlugIns::HOOK_CREDITS_SHOW_CREDITS, $credits);
        Template::getInstance()->display('Credits', 'credits', $credits);
    }
}
